import { Grid, Typography,makeStyles, Card, CardMedia, Button } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) =>({
    toolbar: theme.mixins.toolbar,
text:{
    fontFamily:'Rosarivo',
    fontSize:'50px',
    padding:theme.spacing(3)
},
button:{
    backgroundColor:'#C7DFC1',
    color:'#1B224A ',
    margin:theme.spacing(3),
    padding:'8px',
    width:150
}
}))
function Home() {
    const classes=useStyles();
    return (
        <div style={{backgroundColor:'#1b224a',height:'90vh'}} className={classes.toolbar}>
            <Typography variant='h1' container='h5'  style={{color:'#c7dfc1',paddingTop:'150px'}} className={classes.text}>
                Welcome to E-commerce Page
            </Typography>
            <Button variant='contained' className={classes.button}>
                Read more
            </Button>
            <br/>
            <p>
               This is a brand new Ecommerce website with great user experience,
               
            </p>
        </div>
    )
}

export default Home
